import React  from 'react'
import styled from 'styled-components'

const Container=styled.div`
width           : 100%;
height          : 80vh;
background-color: whitesmoke;
margin-top      : 50px;
`;

const StyleWrapper=styled.div`
//width           : 100%;
//height          : 100%;
background-color: yellow;
//margin-left     : auto;
`;
const CountDownWrapper=styled.div`

`;

const TextingDeals = () => {
    return (
       <Container>
            <div class = "container">
                <div class = "row">
                    <div class = "col">
                        <CountDownWrapper>
                            <h1>I am also Visible</h1>
                        </CountDownWrapper>
                    </div>
                    <div class = "col">
                        <StyleWrapper>
                            <h1>I am also Visible</h1>
                        </StyleWrapper>
                    </div>
                </div>
            </div>
        </Container>
    )
}

export default TextingDeals
